import React, { useState } from 'react';
import './Jackpot.css'
import JackpotPlayers from './JackpotPlayers'

const Jackpot = () => {
    const [ gang, setGang ] = useState(false)

    const gangFlagHandler = () => {
        if (gang === true){
            setGang(false)
        }
        else{
            setGang(true)
        }
    }

    return (
        <div className="game-container  ">
            <h2>Welcome to Jackpot</h2>
            <h5>stakes?</h5>
            <input type="text" name="stakes" className="game-input1" id="stakes_input" />
            <h5>gang flag {gang ? ON : OFF}</h5>
            {gang ?
            <button value="reset" onClick={gangFlagHandler} className="game_flag_button">reset</button>
            :
            <button value="set" onClick={gangFlagHandler} className="game_flag_button" >set</button>
            }
            <button className="game-button">START</button>
        </div>

    );
};

export default Jackpot;
